    def test_symmetric(self):
        #struct = [1, 2, 3, {'a': 'b'}, '10', '20']
        struct = 'a'
        self.assertEquals(unserialize(serialize(struct)), struct)

        struct = 1
        self.assertEquals(unserialize(serialize(struct)), struct)

        struct = True
        self.assertEquals(unserialize(serialize(struct)), struct)

        struct = False
        self.assertEquals(unserialize(serialize(struct)), struct)

        struct = 3.14
        self.assertEquals(unserialize(serialize(struct)), struct)

        struct = None
        self.assertEquals(unserialize(serialize(struct)), struct)

        self.assertEquals(unserialize(serialize([])), [])
        self.assertEquals(unserialize(serialize({})), [])
        self.assertEquals(unserialize(serialize(())), [])

        struct = ['1', '2', 3]
        self.assertEquals(unserialize(serialize(struct)), struct)

        struct = {'a': 'b'}
        self.assertEquals(unserialize(serialize(struct)), struct)

        struct = {'a': None, 'b': 10, 'c': 'xxx'}
        self.assertEquals(unserialize(serialize(struct)), struct)

        struct = {'a': [1, 2, 3], 'b': {'sss': '2321'}, 'c': 'asda'}
        self.assertEquals(unserialize(serialize(struct)), struct)

        # struct = [PHP_Class('A', private={'private': 1}, protected={'protected': 2}, public={'public': 3})]
        # self.assertEquals(unserialize(serialize(struct)), struct)

